def CoAng(ax, ay, bx, by):
    a = (ay - by) / (ax - bx)
    b = ay - (a * ax)
    return a, b


def YCorr(x, ax, ay, bx, by):
    a, b = CoAng(ax, ay, bx, by)
    y = a * x + b
    return y


