    for i in range(len(v1)):
        if i == 0 and v1[0][0] == v2[0][0]:
            break
        if v1[i][0] >= v2[0][0]:
            v1 = v1[i:]
            break
    #  preciso definir qual lista tem o menor maximo


    if i == len(v2) and v1[-1][0] == v2[-1][0]:
        return v1, v2

    if v1[-1][0] > v2[-1][0]:
        i = len(v1)
        while i > 0:
            i -= 1  # logo no inicio ja temos v1 decrementao, pois o tamanho da lista conta o indice 0
            if v1[i - 1][0] <= v2[-1][0]:
                v1 = v1[:i]
                break

    else:
        i = len(v2)
        while i > 0:
            i -= 1  # logo no inicio ja temos v1 decrementao, pois o tamanho da lista conta o indice 0
            if v2[i - 1][0] <= v1[-1][0]:
                v2 = v2[:i + 1]
                break
    return v1, v2

